import 'animate.css'

import React from "react";
import loadingPic from './bg.png'
const LandingPage = () => {
  return (
  <main className='flex items-center w-full h-full'>
    
    <img src={loadingPic} height={100} width={100} className=' top-1/2 left-1/2 -m absolute' />
    
  </main>
  );
};



export default LandingPage;
